"use strict";

const typesetter = {};

typesetter.getFormData = () => {
  typesetter.formData = {
    message: document.getElementById("message").value,
    kerning: document.querySelector('input[name="kerning"]:checked').value,
    "fixed-width": parseInt(document.getElementById("fixed-width").value, 10),
    "fixed-height": parseInt(document.getElementById("fixed-height").value, 10),
    "letter-spacing": parseInt(document.getElementById("letter-spacing").value, 10),
    "line-spacing": parseInt(document.getElementById("line-spacing").value, 10),
  };
}

typesetter.setFormData = (options) => {
  Object.keys(options).forEach(key => {
    if (key === "letter-spacing") document.getElementById("letter-spacing").value = `${options[key]}`;
    if (key === "line-spacing") document.getElementById("line-spacing").value = `${options[key]}`;
    if (key === "fixed-width") document.getElementById("fixed-width").value = `${options[key]}`;
    if (key === "fixed-height") document.getElementById("fixed-height").value = `${options[key]}`;
  });
}

typesetter.setFonts = (fonts) => {
  typesetter.fonts = {};
  Object.keys(fonts).forEach(key => {
    typesetter.fonts[key] = { ...fonts[key], blueprint: factorio.decodeBlueprint(fonts[key].blueprint) };
  })
  const select = document.getElementById("select-font");
  select.innerHTML = "";
  Object.keys(fonts).forEach((key, index) => {
    const option = document.createElement("option");
    option.value = key;
    option.innerHTML = key;
    if (index === 0) option.selected = true;
    select.appendChild(option);
  });
  typesetter.onFontChange();
}

typesetter.onFontChange = () => {
  const select = document.getElementById("select-font");
  typesetter.selectedFont = select.value;
  typesetter.getBlueprints();
  if ("defaults" in typesetter.fonts[typesetter.selectedFont]) {
    typesetter.setFormData(typesetter.fonts[typesetter.selectedFont].defaults);
  }
  console.log(typesetter);
}

typesetter.getBlueprints = () => {
  typesetter.blueprintByLabel = {};
  const root = typesetter.fonts[typesetter.selectedFont].blueprint;
  const stack = [{ blueprint: root, path: "" }];
  while (stack.length > 0) {
    const { blueprint, path } = stack.pop();
    const type = [...Object.keys(blueprint)][0];
    if (type === "blueprint_book") {
      const book = blueprint.blueprint_book;
      blueprint.blueprint_book.blueprints.forEach(
        child => stack.push({
          blueprint: child,
          path: `${path}${book.label} → `
        })
      );
    } else if (type === "blueprint") {
      const label = blueprint.blueprint.label;
      typesetter.blueprintByLabel[label] = { blueprint, path: `${path}${label}` }
    }
  }
}

typesetter.createBlueprint = () => {
  typesetter.getFormData();
  const font = typesetter.fonts[typesetter.selectedFont];
  const lines = typesetter.formData.message.split("\n").map(line => line.trim());
  const entities = [];
  const tiles = [];
  const offset = { x: 0, y: 0 };
  let entity_number = 1; // entity_number is 1-indexed in bp string
  const notfound = new Set();
  lines.forEach(line => {
    let lineHeight = 0;
    [...line].forEach(character => {
      // let blueprint = undefined; // typesetter.getBlueprintByLabel(character);
      const label = (font.replacements && character in font.replacements) ? font.replacements[character] : character;
      const blueprint = label in typesetter.blueprintByLabel ? typesetter.blueprintByLabel[label].blueprint.blueprint : undefined;
      if (blueprint) {
        if ("entities" in blueprint) {
          blueprint.entities.forEach(entity => {
            entities.push({
              ...entity, entity_number: entity_number++, position: {
                x: entity.position.x + offset.x,
                y: entity.position.y + offset.y
              }
            })
          });
        }
        if ("tiles" in blueprint) {
          blueprint.tiles.forEach(tile => {
            tiles.push({
              ...tile, position: {
                x: tile.position.x + offset.x,
                y: tile.position.y + offset.y
              }
            });
          });
        }
        const dimensions = {
          x: typesetter.formData["fixed-width"],
          y: typesetter.formData["fixed-height"]
        };
        if (typesetter.formData["kerning"] === "metrics") {
          dimensions.x = blueprint["snap-to-grid"].x;
          dimensions.y = blueprint["snap-to-grid"].y;
        }
        offset.x += dimensions.x + typesetter.formData["letter-spacing"];
        lineHeight = Math.max(lineHeight, dimensions.y);
      } else {
        if (character === " ") {
          offset.x += typesetter.formData["fixed-width"];
        } else {
          notfound.add(label);
        }
      }
    });
    // new line: reset x offset and increment y offset by line height
    offset.x = 0;
    offset.y += lineHeight + typesetter.formData["line-spacing"];
  })
  document.getElementById("font-details").innerHTML = "";
  if (notfound.size > 0) {
    document.getElementById("font-details").innerHTML = "Missing glyphs " + [...notfound].sort().map(label => `<code>${label}</code>`).join(" ");
  }
  const newBlueprint = {
    blueprint: {
      icons: [],
      item: "blueprint",
      label: "Factorio typesetter output",
      version: font.blueprint.blueprint_book.version,
      entities,
      tiles
    }
  };
  console.log(JSON.stringify(newBlueprint.blueprint.entities, null, 2))
  // generate blueprint string
  const newBlueprintString = factorio.encodeBlueprint(newBlueprint);
  document.getElementById("blueprint").value = newBlueprintString
  // get blueprint preview image
  factorio.getBlueprintImageUrl(newBlueprintString).then((url) => {
    window.setTimeout(() => {
      const div = document.getElementById("blueprint-preview");
      div.innerHTML = "";
      const img = document.createElement("img");
      img.src = url;
      img.setAttribute("loading", "lazy");
      img.style.display = "block";
      img.onload = function () {
        img.style.width = `${this.naturalWidth / 1.5}px`;
        img.style.maxWidth = `100%`;
      };
      div.appendChild(img);
    }, 0);
  });
}

